import React from 'react';
import Button from './Button/Button';

const styles = {
  button: {
    marginRight: '500px'
  },
  link: {
    textDecoration: 'none',
    color: 'white'
  }
};

const scraped = (props) => (
  <div  id={props.articleId}>
    <h3 >
      <strong>{props.headline}</strong>
    </h3>
    <h5>News Source: {props.author}</h5>
    <h5>Date: {props.date}</h5>
    <p> {props.summary}</p>
    <button className="btn btn-info" style={styles.button}>Read</button>
    <Button title={props.title} clicked={(event) => props.action(event, props.articleId)} />
  </div>
);

export default scraped;
